INSERT INTO `product` VALUES (1,'雀巢咖啡','固态','42条X13克','Q/QC0001S','6917878033662',NULL,10,NULL,376,5,3,4,'http://211.151.134.74:8080/portal/img/product/nescafe/nescafe1-1.jpg|http://211.151.134.74:8080/portal/img/product/nescafe/nescafe1-2.jpg|http://211.151.134.74:8080/portal/img/product/nescafe/nescafe1-3.jpg','雀巢公司陆续在中国的天津、青岛和东莞等地建起了自己的工厂，1999年秋天，雀巢成功地收购了太太乐集团80%的股份。之后，雀巢又于2001年与中国第二大鸡精生产厂家豪吉公司合作，成立了合资四川豪吉食品有限公司。\r\n雀巢在市场上咄咄逼人的态势，让它的竞争对手感到巨大的压力，国内一个乳制品企业的管理人员将雀巢形容为一个食品领域的“巨人”，随时都可以在相关的竞争领域发起攻势。','所有人群','植脂末[葡萄糖浆、食用氢化植物油、稳定剂（340ii、331iii、452i）、酪蛋白（含牛奶蛋白）、乳化剂、（471、472e）、食用香精、抗结剂（551）]、 白砂糖、速溶咖啡 、食品添加剂[（酸度调节剂（501i）、阿斯甜（含苯丙氨酸）]、食用香精。','010101','规格1--参数2','高蛋白');
