INSERT INTO `product` VALUES (216,'纯牛奶利乐','液体','250ml*24盒','GB 25190',NULL,NULL,279,NULL,375,5,5,5,'http://211.151.134.74:8080/portal/img/product/mengniuchunniunailile/mncnnll.jpg','优质营养：牛奶中的蛋白质、矿物质等营养成分，易被人体吸收。     \r\n品味纯正：蒙牛纯牛奶纯正无添加，带给您自然纯的好口味。     \r\n优享生活：滴滴好品质，让蒙牛牛奶伴您健康生活每一天。','所有人群','生牛乳',NULL,NULL,'');
INSERT INTO `product` VALUES (217,'低脂高钙牛奶利乐砖','液体','250ml*20盒','GB 25191',NULL,NULL,279,NULL,375,5,5,5,'http://211.151.134.74:8080/portal/img/product/mengniudizhigaogainiunaililezhuan/mndzggnnllz.jpg','蒙牛低脂高钙牛奶，脂肪含量比普通牛奶低50%以上，特别添加水解蛋黄粉和乳矿物盐，给予骨骼更多呵护，让身体时刻充满活力。','所有人群（婴幼儿除外）','生牛乳、乳矿物盐、水解蛋黄粉、食品添加剂（微晶纤维素、单硬脂酸甘油酯、羧甲基纤维素钠、卡拉胶、三聚磷酸钠、六偏磷酸钠、焦磷酸钠）、乳矿物盐（添加量：100mg/100g）、水解蛋黄粉（添加量：3mg/100g）',NULL,NULL,'');
INSERT INTO `product` VALUES (218,'低乳糖牛奶','液体','250ml*12盒','Q/NMRY 0030S',NULL,NULL,279,NULL,375,5,5,5,'http://211.151.134.74:8080/portal/img/product/mengniuxinyangdaoditangniunai/mnxyddtnn.jpg','采用EHTTM酶水解技术，微化营养易吸收；乳糖水解易吸收，消除乳糖不耐受；益生元(低聚木糖)，让营养吸收更全面；零蔗糖，口味自然,甜香浓溢。','都市中肠胃消化吸收不好的人','鲜牛奶、食品添加剂（蔗糖脂肪酸酯、单硬脂酸甘油酯、乳糖酶、三聚磷酸钠、卡拉胶）、低聚木糖、食用香精（牛奶香精）、低聚木糖（添加量:49mg/100g）',NULL,NULL,'');
INSERT INTO `product` VALUES (219,'优益乳','液体','458ml*12盒','GB/T 21732',NULL,NULL,279,NULL,375,5,5,5,'http://211.151.134.74:8080/portal/img/product/mengniuyouyiru/mnyyr.jpg','特别添加享誉盛名的活性乳酸菌。有助于分解和消除肠道有害菌，维护人体健康。','酒店消费者','水、生牛乳、白砂糖、食品添加剂【羧甲基纤维素钠、果胶、柠檬酸、山梨酸钾、安赛蜜、阿斯巴甜（含苯丙氨酸）】、保加利亚乳杆菌、嗜热链球菌、嗜酸乳杆菌、乳双歧杆菌、食用香精',NULL,NULL,'');
INSERT INTO `product` VALUES (220,'优菌乳','液体','458ml*12盒','GB/T 21732',NULL,NULL,279,NULL,375,5,5,5,'http://211.151.134.74:8080/portal/img/product/mengniuyijunru/mnyjr.jpg','特别添加享誉盛名的活性乳酸菌。有助于分解和消除肠道有害菌，维护人体健康。','酒店消费者','水、生牛乳、低聚果糖（添加量：5g/kg）、食品添加剂【木糖醇（添加量：5g/kg）、羧甲基纤维素钠、果胶、柠檬酸、山梨酸钾、安赛蜜、阿斯巴甜（含苯丙氨酸）】、保加利亚乳杆菌、嗜热链球菌、食用香精',NULL,NULL,'');
INSERT INTO `product` VALUES (221,'联杯菠萝','液体','100g/盒',NULL,NULL,NULL,367,NULL,377,5,5,5,'http://211.151.134.74:8080/portal/img/product/liangbeiboluo/lianbeiboluo.jpg','新鲜牛奶中加入天然果汁，补充人体所需各种维生素，新鲜水果口味配合香浓牛奶，口味更浓、更鲜、更自然。','高端人群',NULL,NULL,NULL,'');
INSERT INTO `product` VALUES (222,'1953黑加仑','液体','200g/袋',NULL,NULL,NULL,367,NULL,377,5,5,5,'http://211.151.134.74:8080/portal/img/product/1953heijialun/1953heijialun.jpg','山花1953鲜牛奶精选优质牛奶，采用闪蒸技术，脱掉牛奶中的部分水分，使口感更浓、更香、更淳，特别添加乳糖酶，缓解“乳糖不耐症”；山花1953酸牛奶特别添加益生菌，富含VB1、VB2、VB6、VB12等多种维生素，有利于钙、磷等元素的吸收。1953鲜牛奶和酸牛奶，全家营养好保障。','中高端人群',NULL,NULL,NULL,'');
INSERT INTO `product` VALUES (223,'壶装酸奶','液体','1.2L/瓶',NULL,NULL,NULL,367,NULL,377,5,5,5,'http://211.151.134.74:8080/portal/img/product/huzhuangshuannai/huzhuangshuannai.jpg','100％鲜纯，鲜香宜人；纯鲜奶经巴氏消毒；能很好的保存牛奶的营养价值，避免营养流失；经济实惠。','缺钙人群',NULL,NULL,NULL,'');
INSERT INTO `product` VALUES (224,'黄牛奶','液体','243ml/盒',NULL,NULL,NULL,367,NULL,377,5,5,5,'http://211.151.134.74:8080/portal/img/product/huangniunai/huangniunai.jpg','特别添加活性乳酸菌，除保留鲜牛奶的全部营养成分外，使多种维生素更易被人体吸收。不易发生腹胀，气多或腹泻现象，特别适合对乳糖消化不良的人群。特浓酸奶是“肠道清道夫”，是益生菌的丰富源泉。调节改善肠道微环境。1.2升大壶装，更实惠，能满足一家人一天的健康营养需求。','肠胃消化吸收不好的人',NULL,NULL,NULL,'');
INSERT INTO `product` VALUES (225,'红油腐乳','半固体','260g/瓶',NULL,NULL,NULL,371,NULL,382,5,5,5,'http://211.151.134.74:8080/portal/img/product/hongyoufuru/hongyoufuru.jpg','红油腐乳是贵州的地方风味产品，产品是全自然的发酵过程，从外到里松软一致，富含蛋白质，口感一流。','3岁以上','大豆、水、大豆油、食盐、辣椒、花椒、白酒',NULL,NULL,'');
