INSERT INTO `product` VALUES (227,'生抽王','液体','500ml/瓶',NULL,NULL,NULL,371,NULL,382,5,5,5,'http://211.151.134.74:8080/portal/img/product/shengchouwang/shengchouwang.jpg','酱油是我国传统的调味品。味莼园生产的系列酱油选用优质原料，秉承传统工艺，采用先进技术天然发酵。可直接点蘸、佐餐、凉拌、炒菜等，可为菜肴增滋加味，添香增色。','3岁以上','水、脱脂大豆、麦麸、食用盐、白酒、谷氨酸钠（味精）、5\'-呈味核苷酸二钠、苯甲酸钠、安赛蜜、氨基酸态氮：≥0.70g/100mL',NULL,NULL,'');
